import Axios from 'axios';

const Server = {
    fetchTableData: (tableName) => {
        return Axios.get(`http://localhost:3001/table/${tableName}`, {})
            .then(response => response)
    },
    insertIntoTable: () => {
        return Axios.post(`http://localhost:3001/insert`, {})
            .then(response => response);
    }
}

export default Server;
